    0:
        # priority to PG mapping for UC traffic, 8 profiles (IDs), 16 priorties
        TM_ING_UC_ING_PRI_MAP:
            ?
                # Profile 0
                TM_ING_UC_ING_PRI_MAP_ID: [0,7]
                ING_PRI: [0,15]
            :
                TM_PRI_GRP_ID: 0

        # priority to PG mapping for MC traffic, 8 profiles( IDs) 16 priorities
        TM_ING_NONUC_ING_PRI_MAP:
            ?
                # Profile 0
                TM_ING_NONUC_ING_PRI_MAP_ID: [0,7]
                ING_PRI: [0,15]
            :
                TM_PRI_GRP_ID: 0

        TM_PRI_GRP_POOL_MAP:
            ?
                TM_PRI_GRP_POOL_MAP_ID: [0,7]
                TM_PRI_GRP_ID: [[0,7]]
            :
                TM_ING_SERVICE_POOL_ID: 0
                TM_HEADROOM_POOL_ID: 0

        # PFC generation: Priority group(s)
        TM_PFC_PRI_TO_PRI_GRP_MAP:
            ?
                TM_PFC_PRI_TO_PRI_GRP_MAP_ID: [0,7]
                PFC_PRI: [0,7]
            :
                TM_PRI_GRP_ID: 0

